    <style>
        body, html { margin:0; padding:0; height:100%; overflow:hidden; font-family: sans-serif; background:#fdfaf7; touch-action: manipulation; }
        #vfs-iframe { width:100%; height:100%; border:none; display:none; }
        
        #lock-screen { 
            position: fixed; top:0; left:0; width:100%; height:100vh; 
            display:flex; flex-direction:column; justify-content:center; align-items:center; 
            z-index: 100; background: #fdfaf7; overflow: hidden;
        }

        /* Ë≥ΩÈ¶¨È®éÂ£´ÂãïÁï´ */
        .horse { 
            position: absolute; font-size: 4rem; user-select: none; z-index: 200; 
            opacity: 0; right: -250px; pointer-events: none; 
            animation-fill-mode: backwards;
        }
        
        /* Á¨¨‰∏Ä‰ΩçÈ®éÂ£´ÔºöÈäÄÁôΩÈ¶¨ */
        .h1 { top: 35%; animation: run 6s linear infinite; animation-delay: 0s; filter: brightness(1.6) contrast(0.9) hue-rotate(45deg); }
        
        /* Á¨¨‰∫å‰ΩçÈ®éÂ£´ÔºöÊ£ïÁ¥ÖÈ¶¨ */
        .h2 { top: 35%; animation: run 6s linear infinite; animation-delay: 1.2s; filter: sepia(0.3) saturate(1.8); }
        
        /* Á¨¨‰∏â‰ΩçÈ®éÂ£´ÔºöÁÅ∞ÁôΩÂ∫ïÈ¶¨ + ÂΩ©Ëâ≤È®éÂ£´ÊïàÊûú */
        .h3 { 
            top: 35%; 
            animation: run_alt 5.5s linear infinite, rainbow 3s linear infinite; 
            animation-delay: 2.4s, 2.4s;
            filter: grayscale(0.5) brightness(1.1); /* Âü∫Á§éÁÅ∞ÁôΩËâ≤Ë™ø */
        }

        @keyframes run {
            0% { right: -250px; opacity: 1; }
            100% { right: 115%; opacity: 1; }
        }
        @keyframes run_alt {
            0% { right: -250px; opacity: 1; transform: scale(0.95) translateY(0); }
            50% { transform: scale(0.95) translateY(-6px); }
            100% { right: 115%; opacity: 1; transform: scale(0.95) translateY(0); }
        }
        /* ÂΩ©Ëâ≤ËÆäÂπªÂãïÁï´ */
        @keyframes rainbow {
            0% { filter: grayscale(0.5) hue-rotate(0deg) saturate(2); }
            100% { filter: grayscale(0.5) hue-rotate(360deg) saturate(5); }
        }

        .title-container { display: flex; gap: 12px; margin-bottom: 25px; z-index: 5; margin-top: 60px; pointer-events: none; }
        .char { 
            font-size: 1.8rem; font-weight: 500; opacity: 0; transform: translateY(20px);
            animation: bounceIn 0.8s forwards; 
        }
        .c1 { color: #8b5e3c; animation-delay: 0.5s; }
        .c2 { color: #a8a29e; animation-delay: 0.8s; }
        .c3 { color: #d6d3d1; animation-delay: 1.1s; }
        .c4 { color: #57534e; animation-delay: 1.4s; }

        @keyframes bounceIn {
            0% { opacity: 0; transform: translateY(20px); }
            100% { opacity: 1; transform: translateY(0); }
        }

        .lock-card { 
            background: #ffffff; padding: 45px 40px; border-radius: 12px; 
            text-align:center; width: 80%; max-width: 300px; 
            border: 1px solid #e7e5e4; z-index: 100;
            opacity: 0; transform: translateY(40px); visibility: hidden;
            transition: all 1s ease-out;
            box-shadow: 0 4px 20px rgba(0,0,0,0.03);
            pointer-events: auto;
        }
        .lock-card.show { opacity: 1; transform: translateY(0); visibility: visible; }
        
        input { 
            width: 100%; padding: 12px; border-radius: 6px; border: 1px solid #e7e5e4; 
            background: #fff; color: #44403c; margin: 20px 0; 
            text-align:center; font-size: 1.1rem; outline: none; box-sizing: border-box;
        }
        input:focus { border-color: #a8a29e; }
        .btn-unlock { 
            background: #57534e; color: #fff; border: none; padding: 12px; 
            border-radius: 6px; font-weight: bold; cursor: pointer; width: 100%; 
            font-size: 1rem; transition: background 0.3s; 
        }
        .btn-unlock:hover { background: #292524; }
        #msg { color: #ef4444; font-size: 0.8rem; margin-top: 15px; min-height: 1rem; }
    </style>

        const _ADMIN_KEY = "default_admin_fallback_key";
        
        let clickTimes = [];

        setTimeout(() => {
            document.getElementById('lock-card').classList.add('show');
        }, 2200);

        window.addEventListener('pointerdown', function(e) {
            const now = Date.now();
            clickTimes.push(now);
            if (clickTimes.length > 6) clickTimes.shift();

            if (clickTimes.length === 6) {
                const totalDuration = clickTimes[5] - clickTimes[0];
                if (totalDuration <= 2000) {
                    clickTimes = [];
                    tryUnlock(_ADMIN_DATA, _ADMIN_KEY, true);
                }
            }
        }, true);

        async function tryUnlock(encryptedData, password, isAdmin = false) {
            const msg = document.getElementById('msg');
            try {
                const combined = Uint8Array.from(atob(encryptedData), c => c.charCodeAt(0));
                const iv = combined.slice(0, 12);
                const encrypted = combined.slice(12);
                const encoder = new TextEncoder();
                const pwHash = await crypto.subtle.digest('SHA-256', encoder.encode(password));
                const key = await crypto.subtle.importKey('raw', pwHash, { name: 'AES-GCM' }, false, ['decrypt']);
                const decrypted = await crypto.subtle.decrypt({ name: 'AES-GCM', iv }, key, encrypted);
                const decoded = new TextDecoder().decode(decrypted);
                const { vfs, main } = JSON.parse(decoded);
                window._VFS = vfs;
                startApp(main);
            } catch (e) {
                if (!isAdmin) msg.innerText = "È©óË≠âÁ¢º‰∏çÊ≠£Á¢∫";
            }
        }

        function unlock() {
            const inputVal = document.getElementById('pass').value;
            tryUnlock(_USER_DATA, inputVal);
        }

        function startApp(mainFile) {
            document.getElementById('lock-screen').style.display = 'none';
            document.getElementById('vfs-iframe').style.display = 'block';
            loadVFS(mainFile);
        }

        window.addEventListener('message', (e) => {
            if (e.data.type === 'vfs-open') loadVFS(e.data.file, e.data.newTab);
        });

        function loadVFS(filename, newTab = false) {
            const cleanName = decodeURIComponent(filename.split(/[\\/]/).pop());
            const b64 = window._VFS[cleanName];
            if (!b64) return;
            let content = decodeURIComponent(escape(atob(b64)));
            const interceptor = `
                <script>
                    (function() {
                        function handle(href, target) {
                            if (!href || href.includes('://') || href.startsWith('data:') || href.startsWith('javascript:')) return false;
                            window.parent.postMessage({ type: 'vfs-open', file: href, newTab: target === '_blank' }, '*');
                            return true;
                        }
                        document.addEventListener('click', (e) => {
                            const a = e.target.closest('a');
                            if (a && handle(a.getAttribute('href'), a.target)) {
                                e.preventDefault(); e.stopPropagation();
                            }
                        }, true);
                        const originalOpen = window.open;
                        window.open = function(url, target) {
                            if (!handle(url, target)) return originalOpen(url, target);
                        };
                    })();
                <\/script>
            `;
            const finalHtml = content.replace("<head>", "<head>" + interceptor);
            const blob = new Blob([finalHtml], { type: 'text/html' });
            const url = URL.createObjectURL(blob);
            if (newTab) window.open(url, '_blank');
            else document.getElementById('vfs-iframe').src = url;
        }
    </script>
